import React from 'react';




class DrumVisualizer extends React.Component{
 

    shouldComponentUpdate(nextProps, nextState){
        return nextProps.keyPressed === ''? false: true;
    }

    render(){
        return(
            <button>
                { 
                    
                    this.props.playList === 'BANK 1'? 
                    this.props.firstPlayList.filter(x => x.key === props.keyPressed)[0].id : 
                    this.props.secondPlayList.filter(x => x.key === props.keyPressed)[0].id
                    
                }
            </button>
        )
    }
}


export default DrumVisualizer;
